import React from 'react';

function UserList(){
    const users = [
        {
            id : 1,
            username: 'test1',
            email: 'test1@naver.com',
        },
        {
            id : 2,
            username: 'test2',
            email: 'test2@naver.com',
        },
        {
            id : 3,
            username: 'test3',
            email: 'test3@naver.com',
        },
    ];
    return (
        <div>
            <div>
                <b> {users[0].username}</b><span>({users[0].email})</span>
            </div>
        </div>
    )

}

export default UserList;
